// src/exceptions/AilogwException.ts
var AilogwException = class extends Error {
  constructor(message) {
    super(message);
    this.name = "AilogwException";
    Object.setPrototypeOf(this, new.target.prototype);
  }
};
var IncompleteConfig = class extends AilogwException {
  constructor(message = "Incomplete configuration for Ailogw") {
    super(message);
    this.name = "IncompleteConfig";
    Object.setPrototypeOf(this, new.target.prototype);
  }
};
var RealtimeConnectionFailed = class extends AilogwException {
  constructor(message = "Websocket connection failed") {
    super(message);
    this.name = "RealtimeConnectionFailed";
    Object.setPrototypeOf(this, new.target.prototype);
  }
};
export {
  AilogwException,
  IncompleteConfig,
  RealtimeConnectionFailed
};
